// src/pages/Home.jsx
import React from "react";
import Navbar from "../components/Navbar";
import { Header, HomeNav, HomeNavLink, Main, Portfolio, Name, Week, Footer, FooterImg } from "../styles/HomeStyles";

const homeLinks = [
  { text: "About me", href: "aboutme.html" },
  { text: "Contact", href: "contact.html" },
  { text: "Home", href: "home.html" },
];

const Home = () => {
  return (
    <>
      <header>
        <h2>Likelion 13th_FrontEnd Baby Lion ü¶Å</h2>
      </header>

      <Navbar navClass="home-nav" links={homeLinks} emphasis="Home" />

      <main>
        <div className="home">
          <div className="portfolio dosis-font">Portfolio</div>
          <div className="name dosis-font">Lee-Eunji</div>
          <div className="week dosis-font">WEEK 3</div>
        </div>
      </main>

      <footer>
        <img
          src="https://capsule-render.vercel.app/api?type=waving&color=1A7ECF&height=200&section=footer"
          alt="footer"
        />
      </footer>
    </>
  );
};

export default Home;
